import { Provider } from "react-redux";
import "./App.css";
import BookingRow from "./components/BookingRow";
import InputData from "./components/InputData";
import store from "./redux/store";

function App() {
  return (
    <Provider store={store}>
      <header id="header">
        <div class="container">
          <img src="./img/lws-logo.svg" alt="logo" class="logo" />
          <div class="flex items-center">
            <a class="text-white min-w-[50px] font-medium" href="#">
              Home
            </a>
            <button class="log-btn btn">Login</button>
          </div>
        </div>
      </header>

      <section>
        {/* <!-- Input Data --> */}
        <InputData />

        {/* <!-- Preview Data --> */}
        <div class="table-container">
          <table class="booking-table">
            <thead class="bg-gray-100/50">
              <tr class="text-black text-left">
                <th>Destination From</th>
                <th>Destination To</th>
                <th class="text-center">Journey Date</th>
                <th class="text-center">Guests</th>
                <th class="text-center">Class</th>
                <th class="text-center">Delete</th>
              </tr>
            </thead>
            <tbody class="divide-y divide-gray-300/20" id="lws-previewBooked">
              {/* <!-- Row 1 --> */}
              <BookingRow />
            </tbody>
          </table>
        </div>
      </section>
    </Provider>
  );
}

export default App;
